import React,{useState} from 'react'
import Navigation from './Navigation-ash'
import Nav from './Nav'

const Log = (props) => {
   let [mail,setMail]=useState()
   let [password,setPassword]=useState()
   let url = 'http://127.0.0.1:8000/api/token/'
   let handleSubmit =()=>{
      axios.post(url,{
         email:mail,
         password:password
      })
      .then((response)=>{
         console.log(response)
      })
      .catch((err)=>{
         console.log(err)
      })
   }
    return(

       <div className="reg-background">
       <Nav binary={props.binary===0?1:0}  stick={true} ase={true} searchon={true}  colour={'white'}/>
           <div className="login-inputs gone">
       		 <h1 className="headline">
       			Log in your account. 
       		 </h1>



              <input onChange={()=>setEmail} value={mail}  placeholder="Email" type="text" className="email"/>
              <input onChange={()=>setPassword} value={password}  placeholder="Enter password" type="text" className="password"/>

             <div className="but">
             	<button onClick={props.func} >Login</button>
             </div>
           </div>
         </div>  
    )	


}
export default Log
